        ':hover:active': {
            [`& .${compoundButtonClassNames.secondaryContent}`]: {
                color: tokens.colorNeutralForegroundOnBrand
            }
        },
        '@media (forced-colors: active)': {
            [`& .${compoundButtonClassNames.secondaryContent}`]: {
                color: 'HighlightText'
