    medium: {
        ...shorthands.padding('14px', tokens.spacingHorizontalM, tokens.spacingHorizontalL, tokens.spacingHorizontalM),
        fontSize: tokens.fontSizeBase300,
        lineHeight: tokens.lineHeightBase300
