    large: {
        ...shorthands.padding('18px', tokens.spacingHorizontalL, tokens.spacingHorizontalXL, tokens.spacingHorizontalL),
        fontSize: tokens.fontSizeBase400,
        lineHeight: tokens.lineHeightBase400
